function show():JSX.Element{
    return (
        <div >
            {props.list?.map( (job:any) => {JSON.stringify(job.id)} )}


        </div>
    )
}
    return (
<div >
            Memory

        <button onClick={props.remember}>
            remeber current Job
    </button>

        <button onClick={props.clearMemory}>
            clear Memory
    </button>

        {show()}
        </div>

    );    
}

